import React from "react";

// components
import NightLifeCarousal from "./NightLifeCarousal";

const NightLife = () => {
  return (
    <div>
      <NightLifeCarousal />
      <h1 className="text-xl my-4 md:my-8 md:text-3xl md:font-semibold">
        Nightlife Restaurants in Vijay Nagar
      </h1>
    </div>
  );
};

export default NightLife;
